      <div
        class="flex flex-col justify-center items-start gap-4 bg-[#F2F2F2] p-4"
      >
        <h1 class="text-2xl font-bold">TELL US ABOUT YOURSELF...</h1>
        <div class="ml-4">
          <p>MY NAME</p>
          <div class="flex justify-between items-center gap-2">
            <input
              type="text"
              placeholder="First Name"
              class="border-8 border-[#B9D3CE] pl-4 py-2 text-[#749787] font-bold"
            />
            <input
              type="text"
              placeholder="Last Name"
              class="border-8 border-[#B9D3CE] pl-4 py-2 text-[#749787] font-bold"
            />
          </div>
        </div>
        <div class="ml-4">
          <p>GENDER</p>
          <select
            class="border-8 border-[#B9D3CE] pl-4 py-2 text-[#749787] font-bold"
          >
            <option value="0" selected>Month</option>
            <option value="1">January</option>
            <option value="2">February</option>
            <option value="3">March</option>
            <option value="4">April</option>
            <option value="5">May</option>
            <option value="6">June</option>
            <option value="7">July</option>
            <option value="8">August</option>
            <option value="9">September</option>
            <option value="10">October</option>
            <option value="11">November</option>
            <option value="12">December</option>
          </select>
        </div>
        <div class="ml-4">
          <p>BIRTHDAY</p>
          <div class="flex justify-between items-center gap-2">
            <select class="pl-4 pr-36 py-2">
              <option value="1">Male</option>
              <option value="2" selected>Female</option>
            </select>
            <input
              type="number"
              min="1"
              max="12"
              placeholder="Month"
              class="pl-4 pr-10 py-2"
            />
            <input
              type="number"
              min="1900"
              max="2024"
              placeholder="Year"
              class="pl-4 pr-10 py-2"
            />
          </div>
        </div>
        <div class="ml-4">
          <p>I LIVE IN</p>
          <input type="text" placeholder="Country" class="pl-4 pr-10 py-2" />
        </div>
        <div class="flex justify-center items-center gap-4 w-full mt-10">
          <button
            class="text-white text-xl bg-[#5CAEC7] px-8 py-2 rounded-xl shadow-[0_5px_10px_#5CAEC7aa]"
          >
            SUBMIT
          </button>
          <button class="text-[#5CAEC7] text-xl px-8 py-2">SKIP</button>
        </div>
        <div class="flex justify-center items-center gap-2 w-full">
          <button
            class="bg-[#BF8262] ring-2 ring-[#F4CCB6] p-[2px] rounded-full"
          ></button>
          <button class="bg-[#B7B7B7] p-[2px] rounded-full"></button>
          <button class="bg-[#B7B7B7] p-[2px] rounded-full"></button>
        </div>
      </div>
